import React, { Component } from "react";
import Navbar from "../components/Navbar";
import { Form, Col, Button } from "react-bootstrap";
import "./bands.css";
import background from "../Assets/img/bands.jpg";
import axios from "axios";

const backgroundHead = {
  backgroundImage: "url(" + background + ")"
};

class Bands extends Component {
  state = {
    bands: "",
    email: "",
    date: "",
    type: "",
    county: ""
  };

  handleChange = e => {
    this.setState({
      [e.target.name]: e.target.value
    });
  };
  handleSubmit = e => {
    e.preventDefault();

    const { bands, email, date, type, county } = this.state;
    if (!bands || !email || !date || !type || !county) return;
    axios.post("/api/bands", { bands, email, date, type, county });

    // console.log("Before Fetch");
    // // ----------------------------------------------------------------------------
    // // Does there need to be another package.json in src to get proxy to work
    // // Proxy bridges the gap to alow react to connect to backend routes like '/api/bands'
    // // ----------------------------------------------------------------------------
    // fetch("/api/bands", {
    //   method: "POST",
    //   headers: {
    //     "Content-Type": "application/json"
    //   },
    //   body: JSON.stringify({
    //     bands,
    //     email,
    //     date,
    //     type,
    //     county
    //   })
    // })
    //   .then(res => res.json())
    //   .then(res => {
    //     if (!res.success)
    //       this.setState({
    //         error: res.error.message || res.error
    //       });
    //     else
    //       this.setState({
    //         author: "",
    //         text: "",
    //         error: null
    //       });
    //   });
    // console.log("Stuff", this.state);
  };

  render() {
    return (
      <div>
        <Navbar />
        <Form className="formBand" style={backgroundHead}>
          <Form.Row>
            <Form.Group as={Col} controlId="formGridEmail">
              <Form.Label>Band Name</Form.Label>
              <Form.Control
                type="text"
                name="bands"
                defaultValue={this.state.bands}
                placeholder="Band Name"
                onChange={this.handleChange}
              />
            </Form.Group>
          </Form.Row>
          <Form.Row>
            <Form.Group as={Col} controlId="formGridEmail">
              <Form.Label>Email</Form.Label>
              <Form.Control
                type="email"
                name="email"
                defaultValue={this.state.email}
                placeholder="Email"
                onChange={this.handleChange}
              />
            </Form.Group>
          </Form.Row>

          <Form.Row>
            <Form.Group controlId="formInstrument">
              <Form.Label>Date Needed</Form.Label>
              <Form.Control
                type="date"
                name="date"
                defaultValue={this.state.date}
                placeholder="Date Needed"
                onChange={this.handleChange}
              />
            </Form.Group>
          </Form.Row>
          <Form.Row>
            <Form.Group as={Col} controlId="formMusician">
              <Form.Label>Musician Needed</Form.Label>
              <Form.Control
                as="select"
                name="type"
                defaultValue={this.state.type}
                placeholder="type"
                onChange={this.handleChange}
              >
                <option>Choose...</option>
                <option>Guitar</option>
                <option>Drummer</option>
                <option>Bass</option>
                <option>Vocals</option>
              </Form.Control>
            </Form.Group>
          </Form.Row>
          <Form.Row>
            <Form.Group as={Col} controlId="formGridState">
              <Form.Label>County</Form.Label>
              <Form.Control
                as="select"
                name="county"
                defaultValue={this.state.county}
                placeholder="County"
                onChange={this.handleChange}
              >
                <option>Choose...</option>
                <option>Cuyahoga</option>
                <option>Summit</option>
              </Form.Control>
            </Form.Group>
          </Form.Row>

          <Button onClick={this.handleSubmit} variant="primary" type="button">
            Submit
          </Button>
        </Form>
      </div>
    );
  }
}
export default Bands;
